function Appointment() {
  return (
    <section id="appointment" className="section">
      <h2>Book Appointment</h2>
      <form className="form">
        <input placeholder="Name" />
        <input placeholder="Phone" />
        <input type="date" />
        <button>Book Now</button>
      </form>
    </section>
  );
}

export default Appointment;
